{"type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v3.json",
  "data": [
    {"name": "payload", "values": [{"amount": 88}]},
    {
      "name": "data",
      "values": [{"amount": 88}],
      "transform": [
        {"type": "formula", "expr": "sequence(0, 100,1)", "as": "sequence"},
        {"type": "flatten", "fields": ["sequence"]},
        {"type": "pie", "field": "sequence", "startAngle": 0, "endAngle": 3.15},
        {"type": "filter", "expr": "datum.sequence <= datum.amount"},
        {"type": "project", "fields": ["sequence", "startAngle", "endAngle"]}
      ]
    }
  ],
  "scales": [
    {
      "name": "trigo_background",
      "type": "linear",
      "domain": [0, 100],
      "range": [3.14, 0]
    },
    {
      "name": "color",
      "type": "linear",
      "domain": [0, 25, 50, 75, 100],
      "range": {"scheme": "redyellowgreen"},
      "reverse": true
    }
  ],
  "axes": [],
  "marks": [
    {
      "type": "arc",
      "from": {"data": "data"},
      "encode": {
        "enter": {
          "startAngle": {"signal": "datum.startAngle-1.57"},
          "endAngle": {"signal": "datum.endAngle-1.57"},
          "outerRadius": {"value": 450},
          "innerRadius": {"value": 300},
          "x": {"signal": "width/2"},
          "y": {"signal": "height/2+300"},
          "fillOpacity": {"value": "0.8"},
          "fill": {"scale": "color", "field": "sequence"}
        }
      }
    },
    {
      "type": "arc",
      "from": {"data": "data"},
      "encode": {
        "enter": {
          "startAngle": {"signal": "datum.startAngle-1.57"},
          "endAngle": {"signal": "datum.endAngle-1.57"},
          "outerRadius": {"value": 450},
          "innerRadius": {"value": 400},
          "x": {"signal": "width/2"},
          "y": {"signal": "height/2+300"},
          "fillOpacity": {"value": "1"},
          "fill": {"scale": "color", "field": "sequence"}
        }
      }
    },
    {
      "type": "text",
      "from": {"data": "payload"},
      "encode": {
        "enter": {"fill": {"value": "#000"}, "text": {"signal": "datum.amount+' %'"}},
        "update": {
          "x": {"signal": "width/2", "offset" : -45},
          "y": {"signal": "height/2+300", "offset" : -100},
          "fontSize": {"value": 50},
        },
        "hover": {"opacity": {"value": 0.5}}
      }
    }
  ]
}"},"title":"[TGS] Number of unused licence"}

{"type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v3.json",
  "title": "Unused licence over time",
  "data": [
    {
      "name": "licence_over_time_actual",
      "url": {
        "index": "licensing-report*",
        "body": {
          "query": {
            "bool": {
              "must": [
                "%dashboard_context-must_clause%",
                {"range": {"event_timestamp": {"%timefilter%": true}}}
              ],
              "must_not": ["%dashboard_context-must_not_clause%"],
              "filter": []
            }
          },
          "aggs": {
            "weekly": {
              "date_histogram": {
                "field": "event_timestamp",
                "interval": "week"
              },
              "aggs": {
                "unique_count": {"cardinality": {"field": "user.keyword"}}
              }
            }
          }
        },
        "size": 0
      },
      "format": {"type": "json", "property": "aggregations.weekly.buckets"},
      "transform": [
        {
          "type": "project",
          "fields": ["unique_count.value", "key"],
          "as": ["count", "event_timestamp"]
        },
        {"type": "formula", "expr": "'real'", "as": "type"},
        {
          "type": "formula",
          "expr": "timeFormat(datum.event_timestamp, '%Y-%m-%d')",
          "as": "event_timestamp"
        }
      ]
    },
    {
      "name": "last_data_actual",
      "url": {
        "index": "licensing-report*",
        "body": {
          "query": {
            "bool": {
              "must": [
                "%dashboard_context-must_clause%",
                {"range": {"event_timestamp": {"%timefilter%": true}}}
              ],
              "must_not": ["%dashboard_context-must_not_clause%"],
              "filter": []
            }
          },
          "aggs": {
            "weekly": {
              "date_histogram": {
                "field": "event_timestamp",
                "interval": "week"
              },
              "aggs": {
                "unique_count": {"cardinality": {"field": "user.keyword"}}
              }
            }
          }
        },
        "size": 0
      },
      "format": {"type": "json", "property": "aggregations.weekly.buckets"},
      "transform": [
        {
          "type": "project",
          "fields": ["unique_count.value", "key"],
          "as": ["count", "event_timestamp"]
        },
        {"type": "extent", "field": "event_timestamp", "signal": "extent_real"},
        {"type": "filter", "expr": "extent_real[1] == datum.event_timestamp"},
        {
          "type": "project",
          "fields": ["count", "event_timestamp"],
          "as": ["count", "event_timestamp"]
        },
        {"type": "formula", "expr": "'real'", "as": "type"},
        {
          "type": "formula",
          "expr": "timeFormat(datum.event_timestamp, '%Y-%m-%d')",
          "as": "event_timestamp"
        }
      ]
    },
    {
      "name": "last_data_pred",
      "url": {
        "index": "licensing-prediction-report*",
        "body": {
          "query": {
            "bool": {
              "must": [
                "%dashboard_context-must_clause%",
                {"range": {"@timestamp": {"%timefilter%": true}}}
              ],
              "must_not": ["%dashboard_context-must_not_clause%"],
              "filter": []
            }
          },
          "aggs": {
            "weekly": {
              "date_histogram": {
                "field": "event_timestamp",
                "interval": "week"
              },
              "aggs": {
                "unique_count": {"cardinality": {"field": "user.keyword"}}
              }
            }
          }
        },
        "size": 0
      },
      "format": {"type": "json", "property": "aggregations.weekly.buckets"},
      "transform": [
        {
          "type": "project",
          "fields": ["unique_count.value", "key"],
          "as": ["count", "event_timestamp"]
        },
        {"type": "extent", "field": "event_timestamp", "signal": "extent_pred"},
        {"type": "filter", "expr": "extent_pred[1] == datum.event_timestamp"},
        {
          "type": "project",
          "fields": ["count", "event_timestamp"],
          "as": ["count", "event_timestamp"]
        },
        {"type": "formula", "expr": "'expected'", "as": "type"},
        {
          "type": "formula",
          "expr": "timeFormat(datum.event_timestamp, '%Y-%m-%d')",
          "as": "event_timestamp"
        }
      ]
    },
    {
      "name": "licence_over_time_expected",
      "source": ["last_data_actual", "last_data_pred"]
    },
    {
      "name": "all_licence_over_time",
      "source": ["licence_over_time_actual", "licence_over_time_expected"]
    }
  ],
  "scales": [
    {
      "name": "licence_percentage",
      "domain": {"data": "all_licence_over_time", "field": "count"},
      "nice": true,
      "range": "height"
    },
    {
      "name": "timestamp",
      "type": "band",
      "domain": {"data": "all_licence_over_time", "field": "event_timestamp"},
      "range": "width",
      "padding": 0.05,
      "round": true
    }
  ],
  "axes": [
    {
      "orient": "left",
      "scale": "licence_percentage",
      "grid": true,
      "gridWidth": 1,
      "labelFontSize": 16,
      "labelPadding": 25,
      "title": "Amount of unused licence",
      "titleFontSize": 20,
      "titlePadding": 15
    },
    {
      "orient": "bottom",
      "scale": "timestamp",
      "grid": true,
      "gridWidth": 1,
      "labelAngle": 40,
      "labelPadding": 25,
      "labelFontSize": 16,
      "title": "Timestamp (weekly)",
      "titleFontSize": 20,
      "titlePadding": 15
    }
  ],
  "marks": [
    {
      "type": "line",
      "from": {"data": "licence_over_time_actual"},
      "encode": {
        "enter": {
          "x": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "y": {"scale": "licence_percentage", "field": "count"},
          "stroke": {"value": "#7D93C8"},
          "interpolate": {"value": "monotone"}
        },
        "update": {"strokeOpacity": {"value": 1}, "strokeWidth": {"value": 10}}
      }
    },
    {
      "type": "line",
      "from": {"data": "licence_over_time_expected"},
      "encode": {
        "enter": {
          "x": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "y": {"scale": "licence_percentage", "field": "count"},
          "stroke": {"value": "#FF3F00"},
          "interpolate": {"value": "monotone"}
        },
        "update": {"strokeOpacity": {"value": 1}, "strokeWidth": {"value": 10}}
      }
    },
    {
      "type": "rule",
      "from": {"data": "last_data_actual"},
      "encode": {
        "enter": {
          "stroke": {"value": "#000000"},
          "y": {"signal": "height"},
          "y2": {"signal": "0"},
          "x": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "x2": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "strokeDash": {"signal": "[1, 10]"},
          "strokeWidth": {"value": 10}
        },
        "update": {},
        "hover": {}
      }
    },
    {
      "type": "symbol",
      "from": {"data": "licence_over_time_actual"},
      "encode": {
        "enter": {
          "x": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "y": {"scale": "licence_percentage", "field": "count"}
        },
        "update": {
          "size": {"value": 300},
          "fill": {"value": "#323A50"},
          "color": {"value": "#323A50"},
          "opacity": {"value": 1},
          "tooltip": {"signal": "'Amout of unused licence : '+datum.count"}
        },
        "hover": {"opacity": {"value": 0.5}}
      }
    },
    {
      "type": "symbol",
      "from": {"data": "licence_over_time_expected"},
      "encode": {
        "enter": {
          "x": {
            "scale": "timestamp",
            "field": "event_timestamp",
            "offset": {"signal": "bandwidth('timestamp')/2"}
          },
          "y": {"scale": "licence_percentage", "field": "count"},
          "fillOpacity": {"signal": "datum.type == 'real' ? 0 : 1"},
          "strokeOpacity": {"signal": "datum.type == 'real' ? 0 : 1"}
        },
        "update": {
          "size": {"value": 300},
          "fill": {"value": "#7F1F00"},
          "color": {"value": "#7F1F00"},
          "opacity": {"value": 1},
          "tooltip": {"signal": "'Amout of unused licence : '+datum.count"}
        },
        "hover": {"opacity": {"value": 0.5}}
      }
    }
  ]
}"},"title":"[TGS] Unused Licence Over Time"}

