        "update": {
          "x2": {"scale": "licence_percentage", "value": 0},
          "x": {"scale": "licence_percentage", "field": "amount"},
          "y": {"scale": "category", "field": "category"},
          "height": {"signal": "bandwidth('category')"},
          "fill": {"value": "#7D93C8"},
