          "tooltip": {
            "signal": "'Amout of unused licence : '+datum.amount"
          }
        },
        "hover": {"opacity": {"value": 0.5}}
      }
    },
    {
      "type": "symbol",
      "from": {"data": "data"},
      "encode": {
        "update": {
          "x": {"scale": "licence_percentage", "field": "amount"},
          "y": {
            "scale": "category",
            "field": "category",
            "offset": {"signal": "bandwidth('category') / 2"}
          },
          "fill": {
            "signal": "datum.diff < 0 ? '#00A260' : datum.diff > 0 ? '#BE0F34' :' #4C0000'"
          },
          "size": {"value": "200"},
          "shape": {
            "signal": "datum.diff > 0 ? 'M 1 -1 L 1 2 L -1 2 L -1 -1 L -2 -1 L 0 -3 L 2 -1'  : datum.diff < 0 ? 'M 1 1 L 1 -2 L -1 -2 L -1 1 L -2 1 L 0 3 L 2 1' :'M 1 -2 L -2 -2 L -2 0 L 1 0 L 1 1 L 3 -1 L 1 -3'"
          }
        }
      }
    },
    {
      "type": "text",
      "from": {"data": "data"},
      "encode": {
        "update": {
          "x": {
            "scale": "licence_percentage",
            "field": "amount",
            "offset": "25"
          },
          "y": {
            "scale": "category",
            "field": "category",
            "offset": {"signal": "bandwidth('category') / 2"}
          },
          "text": {"signal": "datum.diff"},
          "fontSize": {"value": 20}
        }
      }
    }
  ]
}"},"title":"[TGS] Top projects tools unused licence"}

